import './App.css';

function App() {
  return (
<>
    <nav class="navbar navbar-light bg-light">
      <a class="navbar-brand" href="#">
        <img src={myntraLogo} width="30" height="30" alt=""/>
      </a>

    </nav>
</>
 );
}

export default App;
